import React from 'react';
import '../../styles/hover.css';
import computer from '../../images/computer.avif'

const styles = {
  image: {
    position: 'relative',
    width: '80%',
    margin: '25px',
  },
  text: {
    position: 'absolute',
    top: '500px',
    // left: '16px',
  }
}

export default function Portfolio() {
  return (
    <div class="container">
      <div class="row">
        <div class="col"><a href='https://github.com/EricKim86/disney-character-locator' target="blank"><img style={styles.image} src={computer} alt='profile' /></a></div>
        <div class="col"><img style={styles.image} src={computer} alt='profile' /><div style={styles.text}>Bottom Left</div></div>
        <div class="w-100"></div>
        <div class="col"><img style={styles.image} src={computer} alt='profile' /></div>
        <div class="col"><img style={styles.image} src={computer} alt='profile' /></div>
        <div class="w-100"></div>
        <div class="col"><img style={styles.image} src={computer} alt='profile' /></div>
        <div class="col"><img style={styles.image} src={computer} alt='profile' /></div>
      </div>
    </div>

  );
}
